import React, { Component } from "react";
import Landingpage from "./Landingpage";
import Navbar from "./Navbar";
import Navbar_beforelogin from "./Navbar_beforelogin";
<link
  rel="stylesheet"
  href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css"
></link>;

class Home extends Component {
  render() {
    return (
      <div>
        <Navbar_beforelogin />

        <div>
          {/* Main conte */}
          <main class="flex">
            <article class="padding_2x">
              <h1 class="title big"> XYZ Pharmacy</h1>
              <p>
                XYZ Pharmacy Consulting Group (ACG) was founded as a
                professional services firm in 2022 with a view Lorem Ipsum is
                simply dummy text of the printing and typesetting industry.
                Lorem Ipsum has been the industry's standard dummy text ever
                since the 1500s.{" "}
              </p>
              <a href="#solutions" class="btn2">
                Explore more
              </a>
            </article>
          </main>
          <h2>WELCOME to XYZ Pharmacy</h2>
          <br></br>
          <div>
            <p>
              <i>
                This is a one stop solution to all the Pharmacies. Here order
                your medicine from our place and get it as soon as possible.
              </i>
            </p>
          </div>
          <section>
            <p>
              A dummy project developed by a bunch of engineers..Deploying.....
            </p>
          </section>
          {/* <Landingpage /> */}
        </div>
      </div>

      //<p>A dummy project developed by a bunch of engineers..Deploying.....</p>
    );
  }
}

export default Home;
